import React from 'react'
import './Navbar.css'


function Navbar(){
    return(
        <nav className='navbar'>
            <div className='navbar-container'>
                <Link to="/" className="logo">Paradise Springs<i class ="fa-solid fa-unbrella-beach"></i></Link>
            </div>
        </nav>
    );
}

export default Navbar;
